import React from "react";
import { Link } from "react-router-dom";
import { Button, Form, FormGroup, Label, Input, FormText } from "reactstrap";

import Select from "@atlaskit/select";
// import Button from "@atlaskit/button";

// import Form, {
//   Field,
//   FieldGroup,
//   FormHeader,
//   FormSection,
//   FormFooter
// } from "@atlaskit/form";

import "./lhs.css";

const defaultOptions = [
  { label: "Adelaide", value: "adelaide" },
  { label: "Brisbane", value: "brisbane" },
  { label: "Canberra", value: "canberra" },
  { label: "Darwin", value: "darwin" },
  { label: "Hobart", value: "hobart" },
  { label: "Melbourne", value: "melbourne" },
  { label: "Perth", value: "perth" },
  { label: "Sydney", value: "sydney" }
];

export default class LHS extends React.Component {
  constructor(props) {
    super(props);

    // Set initial state
    this.state = {
      name: ""
    };
  }

  render() {
    return (
      <div className="col-md-4 lhs">
        {/* <div className="title">
          <h5>Configure test case</h5> 
          Configure test case
        </div> */}

        <div className="body">
          <h3>
            <i class="fas fa-cogs" /> Configure fractal generation
          </h3>

          <Field label="Number of Raspberry Pis">
            <Input type="select" name="select" id="exampleSelect">
              <option>1</option>
              <option>2</option>
              <option>3</option>
              <option>4</option>
              <option>5</option>
            </Input>
          </Field>

          <Field label="Number of threads">
            <Select />
          </Field>

          <Field label="Iterations">
            <Select />
          </Field>

          <Field label="Threshold">
            <Select />
          </Field>

          <br />
          <Button
            className="w-100 text-center"
            appearance="primary"
            onClick={this.props.runTest}
          >
            Generate fractals <i className="fas fa-arrow-right fa-sm ml-2" />
          </Button>
        </div>

        {/* <div>pis, threads, iterations, threashold</div> */}

        {/* <Field label="Field 1"> */}

        {/* </Field> */}
      </div>
    );
  }
}
